import React from 'react';
import FilaReserva from '../molecules/FilaReserva';

const TablaReservas = ({ reservas, onEdit, onDelete }) => (
  <table className="min-w-full border">
    <thead>
      <tr>
        <th>Cliente</th>
        <th>Glamping</th>
        <th>Fecha Inicio</th>
        <th>Fecha Fin</th>
        <th>Estado</th>
        <th>Acciones</th>
      </tr>
    </thead>
    <tbody>
      {reservas.map(reserva => (
        <FilaReserva
          key={reserva.id}
          reserva={reserva}
          onEdit={onEdit}
          onDelete={onDelete}
        />
      ))}
    </tbody>
  </table>
);

export default TablaReservas;
